import React from 'react';

const Reports = () => {
  return (
    <div style={{ padding: '30px' }}>
      <h2 style={{ fontSize: '1.8rem', marginBottom: '20px', color: '#333' }}>Reports</h2>
      <div style={{ background: 'white', padding: '20px', borderRadius: '8px', boxShadow: '0 2px 8px rgba(0,0,0,0.04)' }}>
        <p style={{ color: '#555' }}>Đây là trang báo cáo. Bạn có thể xem các báo cáo chi tiết về điểm số và học sinh tại đây.</p>
        <p style={{ color: '#555', marginTop: '10px' }}>Các báo cáo có thể bao gồm báo cáo tổng quan, báo cáo theo môn, hoặc báo cáo theo cấp độ.</p>
      </div>
    </div>
  );
};

export default Reports;
